    <Container>
      <DivInput>
        <LogoImg src={logo} />

        <Title>Sign Up</Title>

        <Form onSubmit={handleSubmit}>
          <TextInput>Nome Completo: </TextInput>
          <Input name="email" placeholder="Insira seu Nome Completo" type="email"/>

          <TextInput>Email: </TextInput>
          <Input name="email" placeholder="Insira seu E-mail" type="email"/>

          <TextInput>Senha: </TextInput>
          <Input name="password" placeholder="Insira sua Senha" type="password"/>

          <button type="submit">Cadastrar</button>
          <Link to={"/"}>Entrar</Link>
        </Form>       
      </DivInput>
      <Imagem src={img1} />
    </Container>
  );
}
